import React from "react";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";
import '../block.css';

const gridExamplesPage = () => {
  return (
    <MDBContainer padding="1rem"  background-color=" #33b5e5" border="2px solid #fff" color = "#fff" text-align = "center"  >
      <MDBRow padding="1rem"  background-color=" #33b5e5" border="2px solid #fff" color = "#fff" text-align = "center" >
        <MDBCol top padding="1rem"  background-color=" #33b5e5" border="2px solid #fff" color = "#fff" text-align = "center" >One of three columns</MDBCol>
        <MDBCol middle >One of three columns</MDBCol>
        <MDBCol bottom>One of three columns</MDBCol>
      </MDBRow>
    </MDBContainer>
  );
}

export default gridExamplesPage;
